              Create Exercise
            </Link>
          </li>
          <li>
            <Link to='/user' className='navlink'>
              Create User
            </Link>
          </li>
        </ul> */}
        <div className="navbar">
          <div className="title">
            <div></div>
          </div>
          <div className="linksto">

          </div>
        </div>
      </div>
    );
  }
}

export default Navbar;
